import React, {Component} from "react";
import Head from './component/Head'
import List from './component/List'
import Footer from './component/Footer'

class App extends Component {
    constructor(props) {
        super(props);

        this.state = {
            todos:[
                {
                    id:1,
                    title:'看书一小时',
                    finished:false
                }
            ]
        }
    }
    render() {
        return (
            <div class="todo-container">
                <div class="todo-wrap">
                    {/*头部*/}
                    <Head/>
                    {/*列表*/}
                    <List/>
                    {/*尾部*/}
                    <Footer/>
                </div>
            </div>
        );
    }
}
export default App;
